import React from "react";
import { useRouteError } from "react-router-dom";

const Error = () => {
  const error = useRouteError()
        return (
          <div className="content">
            <div className="errors">
              <h1>{error.status}</h1>
              <h1>{error.data}</h1>
            </div>
          </div>
        
        )
}
  export default Error;
